import React from 'react'
import TableData from './TableData'

function TableRow({ userContact }) {
    for (const userContactData in userContact) {
        if (userContactData !== 'userId' && userContactData !== 'contactId') {
            if (userContactData === 'profile') {
                console.log(userContact[userContactData])
                return (
                    <td>
                        <img
                            src={userContact[userContactData]}
                            alt="user-profile"
                        />
                    </td>
                )
            } else {
                return <td>{userContact[userContactData]}</td>
            }
        }
    }

    return (
        <tr>
            {
                // return <TableData />
            }
        </tr>
    )
}
export default TableRow
